import {motion} from 'framer-motion';

const Home = ({darkMode}) => {
    const darkClassNames = darkMode ? 'bg-black text-gray-500' : 'bg-[#16697A] text-[#FFA62B]'
    return (
        <div className={`${darkClassNames} border-2 h-[100vh] flex flex-col justify-center items-center p-2 snap-center `}>
            <div className='border-2 w-full h-[80vh] flex flex-col justify-between items-center p-4'>
                <div className="w-full h-[80%] border flex flex-col justify-center text-center">
                    <span className={`text-[2.5rem] font-light`}>Preetham Bhavirisetty</span>
                    <span className={`text-[1.5rem] font-light`}>From Student to Fullstack Python Developer</span>
                </div>
                <div className='group/learn border flex flex-col justify-center space-y-0 items-center'>
                    <motion.span className='visible group-hover/learn:invisible'>Logo</motion.span>
                    <motion.span transition={{delay:0.4, duration:1.2}} className='invisible group-hover/learn:visible'>Learn More</motion.span>
                    <motion.span transition={{delay:0.4, duration:1.2}} className='invisible group-hover/learn:visible border border-t-0 border-l-0 rotate-45 px-2 py-2'></motion.span>
                </div>
            </div>
        </div>
    )
}

export default Home;
